    return (
        <div>
            <div className="boxes">
                <div className="box_1" style={{backgroundColor: props.bgcolor}}></div>
                <div className="box_2" >
                    <span>{props.title}</span>
                    <p className="mt-0">{props.content}</p>
                </div>

            </div>
            <div><a href="#">All services</a></div>
        </div>
        
         
    )
}
export default Service;
